    *, *:after, *:before {

    .plug {
        margin: 0 auto;
        width: 100%;
        max-width: 680px;
    }

    .plug-logo {
        text-align: center;
        margin-top: 16px;

            width: 276px;
            height: 47px;
        }

        margin-top: 64px    ;

        color: #3E3A45;

        margin-top: 24px;
        max-width: 526px;
        font-family: "Noto Sans Armenian", sans-serif;
        font-weight: 400;
        font-size: 24px;

        font-size: 26px;
        text-align: center;
        margin-top: 4px;

            width: 100%;
